// mockExchangeData.js
export const mockExchangeRates = {
  USD: 1,     // 1 USD = 1 USD
  AUD: 1.34,  // 1 USD = 1.34 AUD
  MYR: 4.18,  // 1 USD = 4.18 MYR
  NZD: 1.52,  // 1 USD = 1.52 NZD
  SGD: 1.35,  // 1 USD = 1.35 SGD
};
